import { useState } from "react"

function Administrador() {
    

    const [meuArray, setMeuArray] = useState([]);

    const adicionarElemento = (novoElemento) => {
      setMeuArray([...meuArray, novoElemento]);
    };
  
    return (
      <div>
        <p>Array: {meuArray.join(', ')}</p>
        <button onClick={() => adicionarElemento('Novo Elemento')}>Adicionar Elemento</button>
      </div>
    );
  }

export {Administrador}
